import { useContext } from 'react';
import { AuthContext } from '../App';

function Cart() {
  const { token } = useContext(AuthContext);

  return (
    <div>
      <h2>Cart</h2>
      {token ? <p>Your cart is empty. Add items from Home!</p> : <p>Please log in to view your cart.</p>}
    </div>
  );
}

export default Cart;
